INSERT OR REPLACE INTO ezcontentobject_attribute VALUES(0,239,57,0.0,1045487555,replace('<?xml version="1.0"?>\n<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><section><header>Welcome to your new eZ Publish installation</header><paragraph align="LEFT">You chose the Website Interface package with a clean install\n                                        and no evaluation data, this installation is empty of content.\n                                    </paragraph><paragraph align="LEFT">This page is the home page of your website, you can access\n                                        the administration interface of your website by selecting the appropriate check\n                                        box on the<link url_id="23">login page</link>. You will need to use the\n                                        "admin" username and the password you defined when installing eZ Publish.\n                                    </paragraph><paragraph align="LEFT">If you want to use the eZ toolbar for front end editing,\n                                        please\n                                        <link url_id="23">login</link>\n                                        to the website with the same administrator account or with any account you might\n                                        have setup with sufficient rights.\n                                    </paragraph><paragraph align="LEFT">If you want to get started easily and run your website\n                                        project, the usual next steps for you might be:\n                                    </paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ol><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><strong>Configure users and permissions</strong>\n                                                    using the administration interface, to grant access and rights to\n                                                    all the team involved in the making of your website. See<link url_id="24">\n                                                    user manual</link>.\n                                                </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><strong>Customize the layout styles and templates</strong>\n                                                    of your website in order to match your branding requirements. See\n                                                    <link url_id="25">\n                                                        the documentation</link>.\n                                                </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><strong>Add additional new features</strong>\n                                                    leveraging existing extensions in the ecosystem. See<link url_id="26">\n                                                    the documentation</link>.\n                                                </paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><strong>Start publishing content</strong>\n                                                    in the repository and\n                                                    <strong>launch your website.</strong>\n                                                    See<link url_id="27">\n                                                    the documentation</link>.\n                                                </paragraph></li></ol></paragraph><paragraph align="LEFT">For more information, please visit our<link url_id="28">documentation</link>. You might also consider\n                                        exchanging with our community via our\n                                        <link url_id="29">forums</link>\n                                        or browsing existing extensions in the<link url_id="30">\n                                            community contribution corner</link>.\n                                    </paragraph><paragraph align="LEFT">If you are running a business project, you should consider\n                                        help from eZ Systems professional services such as<link url_id="31">training</link>,\n                                        <link url_id="32">consulting\n                                        </link>\n                                        or\n                                        <link url_id="33">Premium</link>\n                                        support and maintenance.\n                                    </paragraph><paragraph align="center"><embed size="medium" view="embed-inline" align="right" custom:offset="0" custom:limit="5" object_id="58"/></paragraph></section></section>\n','\n',char(10)),'ezxmltext',203,'eng-US',3,0,'',1);
